import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import Contemplative from '../images/contemplative.jpg'

export default function ActionAreaCard(props) {
  return (
    <Card sx={{ maxWidth: 345, marginBottom: '10px' }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          width="140"
          image="https://se-images.campuslabs.com/clink/images/92714698-93ba-4502-8c5d-88afda6825efbb9de1b1-6661-4af7-9f99-a7cfee114650.png?preset=med-sq"
          alt="green iguana"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            {props.title}
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{paddingBottom: '10px'}}>{props.description}</Typography>
          <Typography variant="body2" color="text.secondary">Tags:</Typography>

          {props.tags.map((item, index) => (
            <Typography variant='body2' color="text.secondary"><p class="btn btn-primary" style={{cursor: 'default'}}>{item}</p></Typography>
          ))}
          {/* <Typography variant='body2' color="text.secondary"><p class="btn btn-primary" style={{cursor: 'default'}}>{props.tags}</p></Typography>
          <Typography variant='body2' color="text.secondary"><p class="btn btn-primary" style={{cursor: 'default'}}>{props.tags}</p></Typography> */}
        </CardContent>
      </CardActionArea>
    </Card>
  );
}
